import '../styles/Menu.css';
import Select from 'react-select';

const myModel = [
  { text: 'Sklearn', value: 'sklearn' },
  { text: 'Python', value: 'python'},
  { text: 'C++', value: 'C++'},
];

function Menu({selectedModel,setSelectedModel}) {
  const handleChange = selectedModel => {
    setSelectedModel(selectedModel);
  };
  
  return (
    <div className="Menu">
      
        
        <Select
        value={selectedModel}
        options={myModel}
        onChange={handleChange}
        
        />
        <p>
          Cette application a été créée dans le but d'apprendre l'IA dans le cadre de notre projet de 4e année
        </p>
        <p>
          Le dataset est composé de 12 genres : Classical / Disco-Boogie
        </p>
      
    </div>
  );
}

export default Menu;
